					cal: this.cal,
					cycle: this.cycle,
					year: this.year,
					month: this.month,
					day: this.day,
					hour: this.hour,
					minute: this.minute,
					second: this.second,
					millisecond: this.millisecond,
					sync: params && typeof(params.sync) === 'boolean' ? params.sync : true,
					loadParams: params && params.loadParams,
